export function uniqueOnly(value, index, array) {
    return array.indexOf(value) === index;
}
export function uniqueBy(keyFunc) {
    return function (value, index, array) {
        for (var i = 0; i < index; i++) {
            if (keyFunc(value) == keyFunc(array[i])) {
                return false;
            }
        }
        return true;
    };
}
